function ListGroup() {
    const name = 'Samantha Thompson';
    const username = 'tsammie16';
    const email = 'tsammie16@gmail.com';
    const phoneNum = '(636)357-9633'

    const names = [
        'New York',
        'San Francisco',
        'Tokyo',
        'London',
        'Paris'
    ];

    if (names.length === 0) {
        return (
            <>
            <p>No names found</p>
            </>
        )
    }
    return (
    <>
        <ul>
            <li>Name: {name}</li>
            <li>Username: {username}</li>
            <li>Email: {email}</li>
            <li>Phone Number: {phoneNum}</li>
            {names.map((name) => (
                //normally when we get data from api we would have name.id for the key
                <li key={name}>{name}</li>
            ))}
        </ul>
    </>
    )
}

export default ListGroup;
